import React from 'react';
import './email.styles.css'

const Email = ({ id, from, address, time, message, subject, tag, read }) => {
  return (
    <div className={`email ${read === 'true' ? 'read' : 'unread'}`}>
      <div className="email-info">
        <p>{from} &lt;{address}&gt;</p>
        <p>{time}</p>
      </div>
      <h3>{subject}</h3>
      <p>{message}</p>
      <div className="email-tags">
        <span className={`tag ${tag}`}>{tag}</span>
      </div>
    </div>
  );
};

export default Email;
